        return CanInlineResult.NO;
      }
      cArg = cArg.getNext();
    }
  }

  return CanInlineResult.YES;
}

private boolean isDirectCallNodeReplacementPossible(Node fnNode) {
  Node parent = fnNode.getParent();
  if (parent.isExprResult()) {
    parent = parent.getParent();
  }
  return parent.isCall()
      && parent.getFirstChild() == fnNode
      && NodeUtil.isExpressionResultUsed(parent)
      && !NodeUtil.isFunctionExpression(fnNode);
}

