  return sb.toString();
}

void appendHexJavaScriptRepresentation(StringBuilder sb, char c) {
  sb.append("\\u");
  String hex = Integer.toHexString(c);
  for (int i = 0; i < 4 - hex.length(); i++) {
    sb.append('0');
  }
  sb.append(hex);
}

